            'text_en' => '<p>Bruno Balduccini advises domestic and international clients on banking, payments, insurance, M&A, foreign exchange and foreign trade matters. Bruno concentrates his practice on the advisory and transactional needs of financial and payment institutions. With a strong presence in the development of new banking products and solutions involving e-wallets, credit cards, payments and crypto assets, he is also seasoned in open banking and instant payment matters. Bruno has advised on the vast majority of M&A transactions involving financial institutions, startups and payment institutions. He actively participated in the drafting and improvement of the rules for payment systems, credit fintechs (SCDs and SEPs), foreign exchange and open banking laws. At the firm, he set up a program for acceleration of startups and fintechs, helping to create new technologies for the financial and payment environments to foster the startup ecosystem and attract investments.</p>',
