            'text' => '<p>Giuliano Colombo assessora devedores, conselheiros, sócios e acionistas, comitê de credores e ad hoc, potenciais investidores e financiadores, recuperação judicial e extrajudicial de empresas e falências, reestruturação de dívidas, DIP financing, liquidação extrajudicial e intervenção de instituições financeiras, contencioso comercial e cível. Lidera representação de the ad hoc committees of Bondholders em restruturações cross-border, incluindo casos multibilionários como Oi S.A., Odebrecht Oil & Gas, OEA e OGX. Participou de quase todos os casos de alta complexidade envolvendo devedores de diversos segmentos do mercado e de várias indústrias, tais como aviação, autopeças, automotiva, telecomunicações, energia, petróleo e gás, açúcar e álcool, mineração, varejo, imobiliário, construção e alimentício. É membro do Comitê Diretivo do Escritório desde 2018. Integrou a comissão interministerial que deu redação final à Lei de Recuperação de Empresas e Falências (LRF). Frequentemente profere palestras e é autor de vários artigos relacionados à lei de Falências no Brasil e Exterior.
