            'text' => '<p>Luiz Fernando Valente de Paiva atua em processos de recuperação e insolvência em geral, em renegociações de dívida e estruturação de pacote de garantias, bem como contencioso civil e comercial em geral. Assessora titulares de créditos garantidos e quirografários, financiadores, arrendadores, devedores, fundos de investimento e investidores especializados em empresas em dificuldades financeiras. Integrou a comissão interministerial que deu redação final à Lei de Recuperação de Empresas e Falências e atuou como assessor do Governo de Cabo Verde na elaboração de legislação para aprimorar o sistema de insolvência local. Integra os Grupos de Trabalho: (i) para elaboração de projeto de lei com medidas emergenciais para prevenir a insolvência em decorrência dos efeitos da crise causada pela COVID -19; (ii) do Conselho Nacional de Justiça para Aprimoramento da Atuação do Poder Judiciário nos Processos de Recuperação Judicial e de Falências; e (iii) do Banco Mundial para identificar e desenvolver as melhores práticas internacionalmente reconhecidas em regimes de insolvência.</p>',
            'text_en' => '<p>Luiz Fernando Valente de Paiva acts as counsel for clients on restructuring and insolvency proceedings in general, advising on debt renegotiation and on the structuring of security packages as well as on civil and commercial litigation matters in general. Luiz Fernando is seasoned in serving secured and unsecured creditors, lenders, lessors, debtors, investment funds and investors in distressed companies. He was part of the interministerial committee that gave the final wording to the Brazilian Corporate Restructuring and Insolvency Act (LRF), and also advised the Government of Cape Verde on its draft legislation to improve the local insolvency system. Luiz Fernando is a member of working groups created: (i) for the drafting of a bill establishing emergency measures to avoid insolvency on account of the COVID-19 crisis; (ii) by the National Council of Justice (CNJ) to improve court response in judicial restructuring and insolvency proceedings; and (iii) by the World Bank to identify and develop internationally recognized best practices in insolvency regimes.  </p>',
