                'text' => '<p>Mauro Berenholc assessora empresas e associações brasileiras e estrangeiras de diversos setores econômicos em questões ligadas ao comércio internacional, Direito Tributário e Direito Aduaneiro. Possui extensa experiência na condução de processos administrativos e judiciais complexos nas referidas áreas de atuação. Representou os interesses de indústria nacional em caso contencioso perante o órgão de solução de controvérsias da OMC e também atuou como tax expert witness em processo administrativo no Departamento de Comércio dos EUA.</p>',
