            85 => 
            array (
                'id' => 86,
                'name' => 'Renato Stephan Grion',
                'slug' => 'renato-stephan-grion',
                'lawyer_type_id' => 1,
                'lawyer_subtype_id' => NULL,
            'text' => '<p>Renato Stephan Grion desenvolveu sólida formação acadêmica e profissional no Brasil, EUA e França, com vasta experiência em arbitragem comercial e métodos alternativos de resolução de controvérsias. Foi advogado assistente da Secretaria da Corte Internacional de Arbitragem da ICC em Paris. Especializado em arbitragem comercial e contencioso judicial, presta consultoria e atua em diversos casos de arbitragem comercial regidos sob as principais normas institucionais no Brasil e no exterior. Possui sólida experiência e atuação como advogado em processos de homologação de sentenças arbitrais estrangeiras no Brasil. Atua também em mediações. Participou da força-tarefa para a revisão das regras de arbitragem da ICC (versão 2012).</p>',
            'text_en' => '<p>Renato Stephan Grion is a lawyer educated and trained in Brazil, USA and France, and has broad experience in commercial arbitration and ADR. Renato is a former assistant counsel at the Secretariat of the ICC International Court of Arbitration in Paris. He specializes in commercial arbitration and related court litigation, and acts as counsel in a variety of commercial arbitration cases under leading institutional rules in Brazil and abroad. He has broad experience acting as counsel in proceedings for the recognition of foreign arbitration awards in Brazil. He also acts in mediations. He participated in the Task Force on the Revision of the ICC Rules of Arbitration (2012 version). </p>',
                'email' => 'rgrion@pn.com.br',
                'phone' => '+55 11 3247 8965',
                'linkedin' => 'https://www.linkedin.com/in/renato-stephan-grion-3171b32/',
