            86 => 
            array (
                'id' => 87,
                'name' => 'Renê Medrado ',
                'slug' => 'rene-medrado',
                'lawyer_type_id' => 1,
                'lawyer_subtype_id' => NULL,
            'text' => '<p>Renê G. S. Medrado presta assessoria a empresas nacionais e multinacionais, associações de classe em matérias de Comércio Internacional e Concorrência, atuando também no contencioso (arbitral ou judicial) envolvendo essas questões. Possui vasta experiência em Comércio Internacional e disputas comerciais envolvendo antidumping, medidas compensatórias e investigações de salvaguardas, entre outros. Desde 1997, representa empresas em processos de defesa comercial no Brasil ou no exterior. Representou exportadores brasileiros em investigações no exterior, em países como Argentina, Colômbia, Paraguai, EUA, entre outros. Participou de verificações in loco em países como EUA, Reino Unido, Argentina, Chile, Colômbia, México, Áustria, entre outros. Representa regularmente clientes perante as autoridades competentes no Brasil, inclusive em processos de interesse público, mantendo constantemente reuniões perante a Câmara de Comércio Exterior do Brasil (CAMEX), o Ministério da Economia (ME), o Ministério das Relações Exteriores (Itamaraty), entre outros. Tem participado ativamente também de audiências e negociações com autoridades estrangeiras. Aconselhou clientes sobre a compatibilidade de medidas instituídas por diferentes governos à luz da legislação da OMC, tendo também atuado perante o Órgão de Solução de Controvérsias da OMC. Atuou como painelista, indicado pelo Diretor-Geral da OMC, no contencioso DS 513. Por mais de uma década, tem sido classificado como líder de mercado por muitos rankings de reputação, como Chambers, Who’s Who Legal (Thought Leader 2016 e 2018), Best Lawyers, Legal500, Análise Advocacia. Tem mais de duas décadas de intensa atuação em Direito da Concorrência. Assessorou e representou empresas em casos como, por exemplo, LAN/TAM, Braskem/Styrolution, JBS/Tyson, Ri-Happy/PB Kids, Plano de Restruturação da OGX, FMC/Cheminova, Platform (Chemtura)/Arysta, Braskem I, Prosegur/Transfederal, Dow/DuPont, Natura/Avon, Boeing Embraer, entre outros. Também assessorou e representou empresas multinacionais em investigações de cartéis, em casos como Lisina, TFT-LCD, Carbonato de Sódio, Processadores de Tabaco, Agentes de Carga, Carga Aérea, Forex, entre outros. Presta aconselhamento sobre os aspectos concorrenciais de suas atividades, em questões como precificação, distribuição, restrições verticais, entre outros. Também assessorou clientes em processos de observância (compliance) em questões antitruste, capacitando representantes de empresas em diversos níveis, tendo também revisto as diretrizes internas das empresas em matéria de concorrência e conduzido investigações internas nesse contexto. Tem sido consistentemente incluído entre os melhores advogados de Direito Concorrencial no Brasil, por Chambers, Who’s Who Legal, Best Lawyers, Legal500, Análise Advocacia.Possui também vasta experiência no litígio envolvendo questões jurídico-econômicas perante câmaras arbitrais e o Judiciário. No âmbito do contencioso judicial, atuou em processos de alto nível perante o Tribunal de Justiça de São Paulo, bem como perante os tribunais superiores do Brasil (STJ e STF). Atuou como testemunha (expert witness) perante o Tribunal Distrital dos Estados Unidos do Distrito Sul de Nova York.Como atuação institucional, se destacam sua posição como Diretor de Comércio Internacional do IBRAC (2020-2021) e como Officer do International Trade Law Section da International Bar Association (IBA). É Diretor da Columbia Alumni Association Club em São Paulo.</p>',
            'text_en' => '<p>Renê G. S. Medrado counsels multinational corporations, companies and trade associations on Economic Law, and litigates (arbitration and judicially) disputes over International Trade and Competition matters. Mr. Medrado has vast experience in International Trade / trade remedies disputes, such as antidumping, countervailing measures and safeguards investigations. Since 1997, he represents numerous companies (domestic industries, exporters, or importers) in trade remedy proceedings in Brazil or abroad. Mr. Medrado has also represented and counseled Brazilian exporters in investigations abroad, in countries such as Argentina, Colombia, Paraguay, USA, and others. He participated of in-spot verifications in countries such as USA, United Kingdom, Argentina, Chile, Colombia, Mexico, Austria, among others. Under his practice, Mr. Medrado regularly represents clients before the relevant authorities in Brazil, including in public interest proceedings, with constant meetings before CAMEX (the Chamber of Ministries overseeing trade issues), the Ministry of Economy (ME), the Ministry of Foreign Relations (Itamaraty), among others. Mr. Medrado has also actively participated in hearings and negotiations with foreign authorities. He has advised clients on the compatibility of measures instituted by different governments under the WTO law, and acted before the WTO Dispute Settlement. He acted as a Panelist in the dispute DS 513, by appointment of the WTO Director-General. For over a decade, he has been awarded the position of market leader by many reputation rankings, such as Chambers, Who’s Who Legal (Thought Leader – 2016 and 2018), Best Lawyers, Legal500, Análise Advocacia.Mr. Medrado is a seasoned practitioner in the competition law matters, having counseled and represented companies in merger review such as LAN/TAM, Braskem/Styrolution, JBS/Tyson, Ri-Happy/PB Kids, OGX Restructuring Measures, FMC/Cheminova, Platform Specialty (Chemtura)/Arysta, Braskem Formation, Prosegur/Transfederal, Dow/DuPont (Matter of Year - Global Competition Review), Natura/Avon, Boeing/Embraer, to name a few. He has also advised and represented multinational companies in cartel investigations, in such cases as Lysine, TFT-LCD, Soda Ash, Tobacco Processors, Freight Forwarders, Air Cargo, Forex, among others. He counsels companies about competition aspects of their activities, in issues encompassing pricing formation and pricing conduct, distribution issues, vertical restraints, among others. Mr. Medrado has also been advising clients on antitrust compliance, providing training to company representatives at different levels, besides reviewing companies’ internal guidelines on competition matters and conducting internal investigations. He is consistently ranked among the top competition lawyers in Brazil by Chambers, Who’s Who Legal, Best Lawyers, Legal500, Análise Advocacia.Mr. Medrado has also extensive experience litigating Economic Law issues, before arbitration courts or at the judicial courts. At the courts, he has litigated high-profile matters before the São Paulo Court of Justice, and also before the highest courts in Brazil (Superior Tribunal de Justiça and Supremo Tribunal Federal). He served as an expert witness before the United States District Court of the Southern District of New York.Major institucional activities include: Diretor of International Trade at IBRAC (2020-2021) and Officer at the International Trade Law Section of the International Bar Association (IBA). He is an Officer at the Columbia Alumni Association Club in São Paulo</p>',
                'email' => 'rmedrado@pn.com.br',
                'phone' => '+55 11 3247 8797',
                'linkedin' => 'https://www.linkedin.com/in/ren%C3%AA-medrado-0a556214/',
