                'lawyer_subtype_id' => NULL,
            'text' => '<p>Ricardo Binnie atua nas práticas de regulatório bancário e transações financeiras e corporate M&A, com foco em Direito Bancário, financeiro e cambial & Fintechs, meios de pagamento, asset management e societário e M&A. Assessorou diversas instituições financeiras e de pagamento, fintechs e startups, asset managers, entre outros, em uma série de operações no sistema financeiro (SFN) e de pagamentos brasileiro (SPB), desde constituição e processos de autorização, concepção de carteiras digitais, marketplaces, desenvolvimento de novos produtos e parcerias estratégicas, societário e M&A em setores regulados pelo BACEN e CVM, além de consultoria em assuntos societários e regulatórios em geral. </p>',
            'text_en' => '<p>Ricardo Binnie practices in banking regulatory matters and in financial and corporate aspects of M&A transactions, with an emphasis on corporate and banking law, finance and foreign exchange & fintechs, payment methods, asset management, and M&A deals. Ricardo has advised several financial and payment institutions, fintechs and startups, asset managers, among other players, in several transactions and activities in the Brazilian financial system (SFN) and the Brazilian payments system (SPB) comprising setup and authorization procedures, design of e-wallets and marketplaces, development of new products and strategic partnerships, corporate and M&A activities in sectors regulated by the Brazilian Central Bank (BACEN) and the Brazilian Securities Commission (CVM), also engaging in advisory on corporate and regulatory matters in general.</p>',
