                'name' => 'Ricardo Coelho',
                'slug' => 'ricardo-coelho',
                'lawyer_type_id' => 1,
                'lawyer_subtype_id' => NULL,
            'text' => '<p>Ricardo Coelho ingressou em Pinheiro Neto Advogados em 1985, tornando-se sócio em 1996. Possui vasta experiência em direito societário e intensa atuação nos segmentos de project finance, asset finance, comércio exterior, parcerias público-privadas, mercado de capitais (títulos patrimoniais e de dívida), linhas de crédito, joint ventures, fusões e aquisições, arrendamentos, petróleo e gás, energia, direito marítimo, álcool e biocombustíveis, transporte, aviação e seguros. Ao longo das últimas décadas, Ricardo vem prestando assessoria a diversas empresas brasileiras e estrangeiras de grande porte, bem como a instituições financeiras internacionais. Recentemente, Ricardo assessorou os credores KfW e IFC no financiamento de R$ 1,76 bilhão à Gás Natural Açu S.A. para o desenvolvimento, construção e implementação, no Porto do Açu (Brasil), de uma usina térmica de GNL com capacidade de 1,3 gigawatt (GW), incluindo um terminal de regaseificação de GNL para o porto.
</p>',
            'text_en' => '<p>Ricardo Coelho joined Pinheiro Neto Advogados in 1985 and has been a partner since 1996. He has significant experience in corporate law, project finance, asset finance, foreign trade, public-private partnerships, capital markets (equity and debt securities), credit facilities, joint ventures, mergers and acquisitions, leasing, oil and gas, energy, maritime law, ethanol and biofuels, transportation, aviation and insurance industries. Ricardo has traditionally advised several major Brazilian and foreign companies, as well as international financial institutions throughout the last decades. Recently, Ricardo assisted the lenders KfW and IFC in the BRL 1.76 billion Gás Natural Açu S.A. finance for the development, construction and implementation in Açu Port (Brazil) of a thermal LNG plant with capacity of 1.3 gigawatt (GW), including a regasification terminal for the LNG in the port.
</p>',
